import './App.css';
import React, {useState, useContext} from 'react'
import { Link, BrowserRouter as Router, Route} from 'react-router-dom';
import PickLeagues from './PickLeagues';
import {UserContext} from './UserContext'


export default function Signup() {

    const [email, setEmail] = useContext(UserContext);
    const [password, setPassword] = useContext(UserContext);

    /*const [email, setEmail] = useState("");*/




    const clickHandler = () => {

        setEmail("testEmail")
    }



    return (
        <div >
        <h2>Signup {email}</h2>

        <div className="signup-form-items">
            <label htmlFor="email">Enter email</label>
            <input id="email" type="email" placeholder="Email address..."></input>
        </div>

        <div className="signup-form-items">
            <label htmlFor="password">Enter password</label>
            <input id="password" type="password" placeholder="Password..."></input>
        </div>


        <Link to="./">
            <button className="btn btn-dark">Go Back</button>
        </Link>

        <Link to="./PickLeagues">


            <button onClick={clickHandler} className="btn btn-dark">Next</button>
        </Link>


    </div>
    )
}
